INSERT INTO `node_type` VALUES ('legacy_type_one','legacy_type_one','features','legacy_type_one','',1,'Title',1,'Body',0,0,0,1,'legacy_type_one'),('legacy_type_two','legacy_type_two','features','legacy_type_two','',1,'Title',1,'Body',0,0,0,1,'legacy_type_two'),('page','Page','node','A <em>page</em>, similar in form to a <em>story</em>, is a simple method for creating and displaying information that rarely changes, such as an \"About us\" section of a website. By default, a <em>page</em> entry does not allow visitor comments and is not featured on the site\'s initial home page.','',1,'Title',1,'Body',0,1,1,0,'page'),('story','Story','node','A <em>story</em>, similar in form to a <em>page</em>, is ideal for creating and displaying content that informs or engages website visitors. Press releases, site announcements, and informal blog-like entries may all be created with a <em>story</em> entry. By default, a <em>story</em> entry is automatically featured on the site\'s initial home page, and provides the ability to post comments.','',1,'Title',1,'Body',0,1,1,0,'story');
